import React, { useState, useEffect } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

// Authentication
import LoginPage from "./components/auth/LoginPage";
import Register from "./components/auth/Register";
import ProtectedRoute from "./components/auth/ProtectedRoute";

// Homepages (with header + sidebar + footer inside them)
import UserHomage from './components/user/UserHomePage';

import AdminHomepage from "./components/admin/AdminHomePage";

// ====================
// Auth Guard Component
// ====================
const AuthGuard = ({ children }) => {
  const [isLoading, setIsLoading] = useState(true);
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem("token");
    const user = localStorage.getItem("user");

    if (token && user) {
      try {
        const userData = JSON.parse(user);
        if (userData && userData.id) {
          setIsAuthenticated(true);
        }
      } catch (err) {
        console.error("Invalid user data in localStorage:", err);
        localStorage.removeItem("token");
        localStorage.removeItem("user");
      }
    }

    setIsLoading(false);
  }, []);

  if (isLoading) {
    return (
      <div className="min-h-screen bg-gradient-to-br from-[#1A2A80] via-[#3B38A0] to-[#7A85C1] flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-16 w-16 border-b-2 border-white mx-auto mb-4"></div>
          <p className="text-white text-lg font-medium">Loading...</p>
        </div>
      </div>
    );
  }

  return children;
};

// ====================
// Main App Component
// ====================
function App() {
  return (
    <div className="App">
      <Router>
        <AuthGuard>
          <Routes>
            {/* Public Routes */}
            <Route path="/login" element={<LoginPage />} />
            <Route path="/register" element={<Register />} />

            {/* Protected User Routes */}
            <Route
              path="/user-dashboard"
              element={
                <ProtectedRoute requiredRole="USER">
                  <UserHomepage />
                </ProtectedRoute>
              }
            />

            {/* Protected Admin Routes */}
            <Route
              path="/admin-dashboard"
              element={
                <ProtectedRoute requiredRole="ADMIN">
                  <AdminHomepage />
                </ProtectedRoute>
              }
            />

            {/* Default Redirect */}
            <Route
              path="/"
              element={
                <Navigate
                  to={() => {
                    const user = localStorage.getItem("user");
                    if (user) {
                      try {
                        const userData = JSON.parse(user);
                        return userData.role === "ADMIN"
                          ? "/admin-dashboard"
                          : "/user-dashboard";
                      } catch {
                        return "/login";
                      }
                    }
                    return "/login";
                  }}
                  replace
                />
              }
            />

            {/* Catch-all 404 */}
            <Route
              path="*"
              element={
                <div className="min-h-screen flex items-center justify-center bg-gray-100">
                  <div className="text-center">
                    <h1 className="text-2xl font-bold text-gray-800 mb-2">
                      404 - Page Not Found
                    </h1>
                    <p className="text-gray-600 mb-4">
                      The page you are looking for does not exist.
                    </p>
                    <button
                      onClick={() => (window.location.href = "/")}
                      className="px-6 py-3 bg-[#3B38A0] text-white rounded-lg hover:bg-[#1A2A80] transition-colors"
                    >
                      Go Home
                    </button>
                  </div>
                </div>
              }
            />
          </Routes>
        </AuthGuard>
      </Router>
    </div>
  );
}

export default App;
